import React from "react";
import { useEffect } from "react";
import Main from "./main";
import axios from "axios";
import Ei from "./sample";
import { Vt } from "./sample";
import REi from "./result";
import { AREi } from "./result";
import { Res } from "./result";
import { useNavigate } from "react-router";
i

function Votehere() {
  return (
    <div>
      <Main card={<Ei />} home="/main" votehere="/votehere" page="Votehere" />
    </div>
  );
}

function Vote() {
  return (
    <div>
      <Main card={<Vt />} home="/main" votehere="/votehere" page="Votehere" />
    </div>
  );
}

function Result() {
  let l = useNavigate();
  return (
    <div>
      <Main card={<REi />} home="/main" h={()=>{
        l('/results')
      }} page="Result" />
    </div>
  );
}


function ResultA() {  
  let l = useNavigate();
  return (
    <div>
      <Main card={<AREi />} home="/pro" h="/ar" h={()=>{
        l('/results')
      }}  page="Result" />
    </div>
  );
}

function Resultinfo() {
  return (
    <div>
      <Main card={<Res />} home="/main"  page="Resultinfo" />
    </div>
  );
}
export default Votehere;
export {ResultA};
export { Vote };
export { Resultinfo };
export { Result };
